    const handleChange = (event, type) => {
        console.log(event.target.value);
    }
    return (
        <form>
            <div className="">
                <input type="text" name="username" onChange={(event) => handleChange(event, 'username')} />
            </div>
            <div>
                <input type="password" name="password" onChange={(event) => handleChange(event, 'password')}/>
            </div>
            <div>
                <input type="radio" name="userType" />Admin
                <input type="radio" name="userType" />User
            </div>
            <div>
                <Button variant="primary">Login</Button>
            </div>
        </form>
    )
}

export default Login;
